import React from 'react'

export default function Contact() {
  return (
    <section>
      <div className='container-fluid'>
          <h1 className='mt-5'>Contact</h1>
          <p>Name: Krunchas</p>
          <p>Email: krunchas@gmail.com</p>
          <p>Phone: 0123456789</p>
      </div>
    </section>
  )
}
